import React from 'react';
import Header from './header';
import Services from './services';
import Portfolio from './portfolio';
import About from './about';

const homeAssemble = () => {
    return ( 
        <div>
            This is my homepage
            <Header/>
            <Services/>
            <Portfolio/>
            <About/>


        </div>
      );
}
 
export default homeAssemble;
